DROP DATABASE IF EXISTS productes;			#esborrar db
CREATE DATABASE IF NOT EXISTS productes;	#crear db
USE productes;

#Creacio producte
DROP TABLE IF EXISTS producte ; 
CREATE TABLE IF NOT EXISTS producte ( 
	codi INT NOT NULL AUTO_INCREMENT, 
	dataInsercio DATETIME NULL DEFAULT NULL, 
	disponibilitat INT NULL DEFAULT 0, 
	condicions VARCHAR(20) NULL DEFAULT NULL, 
	nom VARCHAR(200) NULL DEFAULT NULL, 
	marca VARCHAR(40) NULL DEFAULT NULL, 
	fabricant VARCHAR(100) NULL DEFAULT NULL, 
	preu FLOAT(8,2) NULL DEFAULT NULL, 
	preuEnviament FLOAT(8,2) NULL DEFAULT NULL, 
	categoriaPrincipal VARCHAR(30) NULL DEFAULT NULL, 
	altreCategoria VARCHAR(200) NULL DEFAULT NULL, 
	imageURL VARCHAR(400) NULL DEFAULT NULL,
	PRIMARY KEY (codi) 
)
ENGINE = InnoDB 
DEFAULT CHARACTER SET = utf8;

#Creacio categoria
DROP TABLE IF EXISTS categoria ;
CREATE TABLE IF NOT EXISTS categoria (
	nom VARCHAR(50), 
	subcategories VARCHAR(4000) NULL DEFAULT NULL, 
	PRIMARY KEY (nom)
)
ENGINE = InnoDB 
DEFAULT CHARACTER SET = utf8;

#Creacio condicions
DROP TABLE IF EXISTS condicions ;
CREATE TABLE IF NOT EXISTS condicions (
	nom VARCHAR(50) NOT NULL, 
	PRIMARY KEY (nom)
)
ENGINE = InnoDB 
DEFAULT CHARACTER SET = utf8;




